import React from "react";
import './Topbar.css';


function Topbar() {
  return(
		<div className="topbar">
			<p><i class="fa fa-phone" aria-hidden="true"></i> +91 (934) 166-6667</p>
			<p><i class="fa fa-map-marker" aria-hidden="true"></i> 404, 1st floor, 4th A Cross Rd, HRBR Layout 2nd Block, Kalyan Nagar, Bengaluru - 560043</p>
			<ul>
				<li><i class="fa fa-facebook" aria-hidden="true"></i></li>
			</ul>
		</div>
	);
}

export default Topbar;
